import { useEffect, useState } from 'react';
import axios from 'axios';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Modal from '@mui/material/Modal';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import MenuItem from '@mui/material/MenuItem';
import { createTheme, ThemeProvider } from '@mui/material/styles';

// TODO remove, this demo shouldn't need to reset the theme.
const defaultTheme = createTheme();

interface User {
  userID: number;
  netID: string;
  username: string;
  email: string;
  type: string;
  firstName: string;
  lastName: string;
  phone: number;
}

export default function MuiTable({ endpoint }: { endpoint: string }) {
  const [tableData, setTableData] = useState<User[]>([]);
  const [selectedUser, setSelectedUser] = useState<User | null>(null);

  useEffect(() => {
    axios.get(endpoint)
      .then(response => {
        const { users } = response.data;
        setTableData(users);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }, []);

  const handleRowClick = (user: User) => {
    setSelectedUser(user);
  };

  const closeModal = () => {
    setSelectedUser(null);
  };

  const handleSubmit = async (event: React.FormEvent<HTMLFormElement>) => {
    event.preventDefault();
    const formData = new FormData(event.currentTarget);
    const formObject: User = {} as User;
    formData.forEach((value, key) => {
      const formKey = key as keyof User;
      // Now TypeScript knows that formKey is a valid key of FormDataObject
      switch (formKey) {
        case 'userID':
          formObject[formKey] = parseInt(value as string, 10); // Parse string to integer
          break;
        case 'phone' :
          formObject[formKey] = parseInt(value as string, 10); // Parse string to integer
          break;
        default:
          formObject[formKey] = value as string;
          break;
      }
    });
    try {
      const response = await axios.put('http://localhost:8000/updateuser/',{
        firstName: formObject.firstName,
        lastName: formObject.lastName,
        username: formObject.username,
        type: formObject.type,
        userID: selectedUser?.userID, 
        netID: formObject.netID,
        email: formObject.email,
        phone: formObject.phone
      });
      console.log('API response:', response.data);
      alert('User updated successfully');
    } catch (error) {
      console.error('Error updating user:', error);
    }
  };

  return (
    <>
      <TableContainer component={Paper} style={{ backgroundColor: "#FAFAFA" }}>
        <Table aria-label="simple table">
          <TableHead>
            <TableRow>
              <TableCell align="center" style={{ verticalAlign: "top" }}>User ID</TableCell>
              <TableCell align="center" style={{ verticalAlign: "top" }}>Net ID</TableCell>
              <TableCell align="center" style={{ verticalAlign: "top" }}>Username</TableCell>
              <TableCell align="center" style={{ verticalAlign: "top" }}>Email</TableCell>
              <TableCell align="center" style={{ verticalAlign: "top" }}>Type</TableCell>
              <TableCell align="center" style={{ verticalAlign: "top" }}>First Name</TableCell>
              <TableCell align="center" style={{ verticalAlign: "top" }}>Last Name</TableCell>
              <TableCell align="center" style={{ verticalAlign: "top" }}>Phone</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {tableData.map((row) => (
              <TableRow key={row.userID} onClick={() => handleRowClick(row)} style={{ cursor: "pointer" }}>
                <TableCell align="center">{row.userID}</TableCell>
                <TableCell align="center">{row.netID}</TableCell>
                <TableCell align="center">{row.username}</TableCell>
                <TableCell align="center">{row.email}</TableCell>
                <TableCell align="center">{row.type}</TableCell>
                <TableCell align="center">{row.firstName}</TableCell>
                <TableCell align="center">{row.lastName}</TableCell>
                <TableCell align="center">{row.phone}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      {selectedUser && (
        <ThemeProvider theme={defaultTheme}>
          <Modal open={true} onClose={closeModal} style={{ display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
            <div style={{ width: '80vw', height: '90vh', backgroundColor: 'white', position: 'relative' }}>
              <button onClick={closeModal} style={{ position: 'absolute', top: '5px', left: '5px' }}>Ã—</button>
              <h1 style={{marginLeft: '20px'}}>Modify {selectedUser.firstName} {selectedUser.lastName}'s Account</h1>
              <Box component="form" noValidate onSubmit={handleSubmit} sx={{ mt: 3 }} style={{marginLeft: '5px', marginRight: '5px'}}>
              <Grid container spacing={2}>
                <Grid item xs={12}>
                  First Name:
                </Grid>
                <Grid item xs={12}>
                  <TextField
                    name="firstName"
                    required
                    fullWidth
                    id="firstName"
                    defaultValue={selectedUser.firstName}
                    autoFocus
                  />
                </Grid>
                <Grid item xs={12}>
                  Last Name:
                </Grid>
                <Grid item xs={12}>
                  <TextField
                    name="lastName"
                    required
                    fullWidth
                    id="lastName"
                    defaultValue={selectedUser.lastName}
                  />
                </Grid>
                <Grid item xs={12}>
                  Username:
                </Grid>
                <Grid item xs={12}>
                  <TextField
                    name="username"
                    required
                    fullWidth
                    id="username"
                    defaultValue={selectedUser.username}
                  />
                </Grid>
                <Grid item xs={12}>
                  Type:
                </Grid>
                <Grid item xs={12}>
                  <TextField
                      select
                      name="type"
                      required
                      fullWidth
                      id="type"
                      defaultValue={selectedUser.type}
